import { Container } from 'react-bootstrap';
import "./Header.css";




const Header =() => {
    return (
        <header className = "header">
            <Container>
                <div className ="navigation">
                    <div className="logo">
                        <h2 className=" d-flex gap-2 align-items-center"></h2>

                    </div>

                </div>

            </Container>

        </header>
    )
}

export default Header
